//cration de l'image FORD (au format 4bpp)
void Create_Image_FORD(void){
	uint32_t i, j, k, ind, myWord;
	uint8_t resu, resuLSB, resuMSB, masqueMSB, masqueLSB;
	masqueMSB = 0xF0;
	masqueLSB = 0x0F;
	for (i=0;i<H_Image_FORD;i++) {
		for (j=0;j<W_Image_FORD/PixelPerWord_Image;j++) { //format 4bpp
			ind = i*W_Image_FORD/PixelPerWord_Image+j;
			*(Image_FORD + ind) = 0; //on remet  0 l'emplacement mmoire de la SRAM
			//on va utiliser 4 octets successifs dans Tab_Image_FORD pour crer un mot de 32 bits
			for (k=0;k<4;k++) {
				//il faut intervertir dans chaque octet les 4 MSB avec les 4 LSB
				resuLSB = Tab_Image_FORD[4*ind+k] & masqueLSB; 
				resuMSB = Tab_Image_FORD[4*ind+k] & masqueMSB; 
				resuLSB = resuLSB << 4;
				resuMSB = resuMSB >> 4;
				resu = resuMSB|resuLSB;
				myWord = resu;
				myWord = myWord << (8*(3-k));
				*(Image_FORD + ind) = myWord | *(Image_FORD + ind);
			}	
		}
	}
}

