//ecriture d'une image quelconque stock en mmoire en un emplacement donn de la mmoire Layer
//paramtres d'entre :
//adress_write : l'adresse de l'emplacement mmoire Layer o on doit crire l'image
//pointer_Picture : Pointeur sur l'adresse o est stock l'image  crire
//W_Picture, H_Picture : largeur et hauteur en pixels de l'image
//PixelPerWord : nombre de pixels encods par un mot de 32 bits (dpendant du format de l'image) 
void write_Image(uint32_t adress_write, uint32_t * Pointer_Picture, uint32_t W_Picture, uint32_t H_Picture, uint8_t PixelPerWord){
	uint32_t i, j, ind;
	uint32_t * MonPointeurMem = (uint32_t *) adress_write;
	for (i=0;i<H_Picture;i++) {
		for (j=0;j<W_Picture/PixelPerWord;j++) {
			ind = i*W_Picture/PixelPerWord+j;
			*(MonPointeurMem+ind) = *(Pointer_Picture+ind);
		}
	}
} 

